function Stars({star}) {
    const stars = Array.from({ length: 5 }, x => x = star )
    return (
        <div className="star-rating">
          {stars.map((star, index) => {
            return (
              <div key={index}>
                {
                  <div key={index}
                  className={index < star ? 'active-color' : 'inactive-color'}>

                 </div>
                }
              </div>
            )
          })}
        </div>
      )
}

export default Stars
